syntax = "proto3";
option java_outer_classname = "DouYinPackWSS";//生成的外部类名，同时也是文件名
option java_package = "com.nfcat.nktool.proto";//生成的外部类名，同时也是文件名


message WssResponse{
  int64 wss_push_room_id = 1;
  int64 wss_push_did = 2;
  int64 wss_push_log_id = 3;
  int64 wss_fetch_ms = 4;
  int64 wss_push_ms = 5;
  string wss_msg_type = 6;
  string pb = 7;
  bytes data = 8;
  int64 server_time = 9;
  string compress_type = 10;
}